  return (
<header class="header">
            <div class="padre">

                <div class="tamaño-logo-div">
                    <a class="btn-logo" href="">
                        <img class="tamaño-logo" src={Tiveo} />
                    </a>
                </div>  
          </div>

        </header>
  )
}
